public class Solution {    public int MajorityElement(int[] nums) {        Dictionary<int, int> frequency = new Dictionary<int, int>();        for(int i = 0; i < nums.Length; i++) {            int currentValue = nums[i];            if(frequency.ContainsKey(currentValue)) {                frequency[currentValue]++;            }            else {                frequency.Add(currentValue, 1);            }        }        foreach(var entry in frequency) {            if(entry.Value > nums.Length / 2) return entry.Key;        }        return -1;    }}